    private static byte[] decrypt(Key key, byte[] bArr) {
        try {
            Cipher instance = Cipher.getInstance("RSA");
            instance.init(2, key);
            return instance.doFinal(bArr);
        } catch (Throwable th) {
            return null;
        }
    }

    private static String decryptFromBase64(Key key, String str) {
        return stringify(decrypt(key, Base64.decode(str, 0)));
    }

    public static String decryption(String str) {
        try {
            return decryptFromBase64(getRSAPrivateKeyFromByte(PRIVATE_KEY), str);
        } catch (Throwable th) {
            return null;
        }
    }

    public static byte[] decryption(byte[] bArr) {
        try {
            return decrypt(getRSAPrivateKeyFromByte(PRIVATE_KEY), bArr);
        } catch (Throwable th) {
            return null;
        }
    }

    private static byte[] encrypt(Key key, byte[] bArr) {
        try {
            Cipher instance = Cipher.getInstance("RSA");
            instance.init(1, key);
            return instance.doFinal(bArr);
        } catch (Throwable th) {
            return null;
        }
    }

    private static String encryptToBase64(Key key, String str) {
        return Base64.encodeToString(encrypt(key, str.getBytes()), 0);
    }

    public static String encryption(String str) {
        try {
            return encryptToBase64(getRSAPublicKeyFromByte(PUBLIC_KEY), str);
        } catch (Throwable th) {
            return null;
        }
    }

    public static byte[] encryption(byte[] bArr) {
        try {
            return encrypt(getRSAPublicKeyFromByte(PUBLIC_KEY), bArr);
        } catch (Throwable th) {
            return null;
        }
    }

    private static PrivateKey getRSAPrivateKeyFromByte(byte[] bArr) throws Exception {
        return KeyFactory.getInstance("RSA").generatePrivate(new PKCS8EncodedKeySpec(bArr));
    }

    private static PublicKey getRSAPublicKeyFromByte(byte[] bArr) throws Exception {
        return KeyFactory.getInstance("RSA").generatePublic(new X509EncodedKeySpec(bArr));
    }

    private static String stringify(String str) {
        String str2 = "";
        for (int i = 0; i < str.length(); i++) {
            str2 = str2 + str.charAt(i);
        }
        return str2;
    }

    private static String stringify(byte[] bArr) {
        return stringify(new String(bArr));
    }
